import React from "react";
import styled from "styled-components";

const Container = styled.div`
  max-width: 960px;
  margin: 0 auto;
  padding: 1rem;
`;

const Header = styled.header`
  display: flex;
  align-items: center;
  justify-content: space-between;
  margin-bottom: 2rem;
`;

const Title = styled.h1`
  font-size: 2rem;
  margin: 0;
`;

const Content = styled.div`
  display: grid;
  grid-template-columns: 1fr;
  gap: 2rem;

  @media (min-width: 768px) {
    grid-template-columns: repeat(2, 1fr);
  }
`;

const Article = styled.article`
  background-color: white;
  box-shadow: 0 0.25rem 0.5rem rgba(0, 0, 0, 0.1);
  padding: 1.5rem;
  border: 1px solid red;
  margin-bottom: 1rem;
`;

const Image = styled.img`
  width: 100%;
  height: auto;
  object-fit: cover;
  margin-bottom: 1rem;
`;

const Code = styled.code`
  font-family: Consolas, monospace;
  background-color: #f1f1f1;
  padding: 0.25rem;
`;
const h2 = styled.h2`
  color:red;
`;



function BlogPost1() {
  return (
    <Container>
    <Header>
      <Title>My Blog</Title>
      <nav>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </nav>
    </Header>
    <Content>
      <Article>
        <Image src="" alt="Blog Post" />
        <h2>My Blog Post</h2>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean id
          semper velit, vitae ultricies magna. In hac habitasse platea dictumst.
          Sed faucibus felis sed eros rutrum viverra.
        </p>
        <Code>{`console.log('Hello, world!');`}</Code>
      </Article>
      <Article>
        <h2>Coding Tips</h2>
        <ul>
          <li>Use descriptive variable names.</li>
          <li>Comment your code.</li>
          <li>Don't repeat yourself.</li>
          <li>Keep your code modular.</li>
        </ul>
      </Article>
    </Content>
    <Content>
      <Article>
        <Image src="https://picsum.photos/id/100/600/400" alt="Blog Post" />
        <h2>My Blog Post</h2>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean id
          semper velit, vitae ultricies magna. In hac habitasse platea dictumst.
          Sed faucibus felis sed eros rutrum viverra.
        </p>
        <Code>{`console.log('Hello, world!');`}</Code>
      </Article>
      <Article>
        <h2>Coding Tips</h2>
        <ul>
          <li>Use descriptive variable names.</li>
          <li>Comment your code.</li>
          <li>Don't repeat yourself.</li>
          <li>Keep your code modular.</li>
        </ul>
      </Article>
    </Content>
  </Container>
  );
}

export default BlogPost1;
